import Header2 from "./Header2";
import Sider from "./Sider";

function Home() {
  return (
    <>
    <div>
      <div
        style={{
          marginTop: "50px",
          backgroundColor: "green",
          width: "5%",
          height: "100vh",
          display: "flex",
          flexDirection: "row",
          display: "flex",
        }}
      >
        <Sider />

      </div>
      <div style={{ backgroundColor: "gray", width: "100%" , height:"10vh" ,margin:"-100vh 9.7vh" }}>
        <div >
        <a style={{margin:"10vh"}}>主頁></a>
        <b>1234</b>
        </div>
        </div>
      </div>

    </>
  );
}
export default Home;
